import { Container, Content } from "./styles";
import Typewriter from 'typewriter-effect'


export function Home(){
    return(
        <Container id="#Home">
            <Content>
                <h1>Hi, I'm <b>Maria.</b></h1>
                <Typewriter
                        options={{
                            strings: ['<sub>Maria</sub>'],
                            autoStart: true,
                            loop: true,
                            // cursor: '', 
                        }}
                />
            </Content>
        </Container>
    )
}
